INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2834, 10118, "ペコリーヌとの出会い", 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 0, 8, 2, 91002, 1, "青空の下で謁見", 40, "フリーマーケット会場", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2835, 10118, "マホとの出会い", 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 0, 8, 2, 91002, 1, "未来の騎空団\nマスコット？", 40, "フリーマーケット会場", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2837, 10118, "アキノとの出会い", 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 0, 8, 2, 91002, 1, "お嬢さまからの\n緊急依頼", 40, "ランドソル市街地", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (4108402, 10118, "ジュンとの出会い", 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 0, 8, 2, 91002, 1, "黄金色の悩みごと", 40, "フリーマーケット会場", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (4107402, 10118, "カオリとの出会い", 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 0, 8, 2, 91002, 1, "白熱！　格闘大会！", 40, "フリーマーケット会場", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (9000227, 10118, "ニノンとの出会い", 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 1, 8, 2, 91002, 1, "祭り太鼓はオーエドの華", 40, "オーエド町", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2101181, 10118, "スズナとの出会い", 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 0, 8, 3, 91002, 1, "人気者は遅れて\nやってくる", 40, "フリーマーケット会場", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (4109402, 10118, "ナナカとの出会い", 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 0, 8, 3, 91002, 1, "巫女・ミーツ・魔法少女", 40, "ランドソル市街地", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (4305402, 10118, "キャル＆コッコロとの出会い", 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 0, 8, 3, 91002, 1, "ネズ耳は二度なくなる", 40, "フリーマーケット会場", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (4101402, 10118, "ユカリとの出会い", 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 0, 8, 3, 91002, 1, "この出会いにカンパイ！", 40, "ランドソル市街地", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (4106402, 10118, "アオイとの出会い", 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 0, 8, 3, 91002, 1, "陰陽アンサンブル", 40, "ランドソル市街地", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2836, 10118, "シノブとの出会い", 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 1, 8, 3, 91002, 1, "運試し十番勝負！", 40, "フリーマーケット会場", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (0, 10118, "オープニング", 5118600, 0, 0, 0, 0, 1, 0, 0, "彼女たちの新たな日常", 0, 0, 20063115);
